import { createStore } from 'vuex'
// import axios from 'axios';

export default createStore({
  state: {
    idCliente:[]
  },
  getters: {
    allDados: state => state.idCliente,
  },
  mutations: {
    idCliente(state, idCliente) {
      state.product = idCliente;
    },
  },
  actions: {
  },
  modules: {
  }
})
